import React from 'react';

export default function VisitsHeader() {
    return (
        <table className='center'>
            <tbody></tbody>
            <tr className='flex center'>
                <td>Visiteurs</td>
                <td>Personne rencontrée</td>
                <td>Entreprise</td>
                <td>Motif visite</td>
                <td>Entrée</td>
                <td>Sortie</td>
            </tr>
        </table>
    );
}
